import React, { Component } from 'react';
import Card from "./card";
import img1 from "./Pictures/img1.jpg";
import img2 from "./Pictures/img2.jpg";

class Cardimp extends Component {
constructor(props){
    super(props)
    this.List = [];
}

    fetchList = ()=> {
        fetch('./list.json')
        .then(rsp => rsp.json())
        .then(lists => {
            this.lists = lists;
        })
    }


 render(){
        return ( 

            <div className="container">
            <div className="container-fluid d-flex justify-content-center">
                <div className="row">
                    <div className="col-md-6">
                        <Card imageSrc={img1} title="Nature" text={this.lists.id.index}/>
                    </div>

                </div>
                <div className="col-md-6">
                        <Card imageSrc={img2} title="Movies" text={this.state.Text2}/>
                    </div>
            </div>
            </div>
         );
    }
}

export default Cardimp;
